    @Test
    public void testLRUCache() {
        LRUCache cache = new LRUCache(3);
        cache.put(1,1);
        cache.put(2,2);
        cache.put(3,3);
        cache.put(4,4);
        int i1 = cache.get(4);
        i1 = cache.get(3);
        i1 = cache.get(2);
        i1 = cache.get(1);
        cache.put(5,5);
        i1 = cache.get(1);
        i1 = cache.get(2);
        i1 = cache.get(3);
        Assert.assertTrue( i1 == 3);
        Assert.assertTrue( i1 == 3);
    }

    @Test
    public void testFreqStack() {
        FreqStack freqStack = new FreqStack();
        freqStack.push(5);
        freqStack.push(7);
        freqStack.push(5);
        freqStack.push(7);
        freqStack.push(5);
        freqStack.push(4);
        int a1 = freqStack.pop();
        int a2 = freqStack.pop();
        Assert.assertTrue( a1 == 5);
        Assert.assertTrue( a2 == 7);

    }

